def parse_html_to_excel(html):
    soup = BeautifulSoup(html, "html.parser")

    data = []

    # Loop through each top-level <tr>
    for row in soup.find_all("tr", class_=["odd", "even"]):
        cells = row.find_all("td", recursive=False)
        if not cells:
            continue

        record = {}

        # Extract File Number, Date, Doc Type
        record["FileNo"] = cells[1].get_text(strip=True) if len(cells) > 1 else ""
        record["FileDate"] = cells[2].get_text(strip=True) if len(cells) > 2 else ""
        record["DocType"] = cells[3].get_text(strip=True).split("\n")[0] if len(cells) > 3 else ""

        # --- Extract Grantors & Grantees ---
        if len(cells) > 4:
            parties_table = cells[4].find("table", id="itemPlaceHolderContainer")
            grantors, grantees = [], []
            if parties_table:
                for tr in parties_table.find_all("tr"):
                    label = tr.find("b")
                    name_span = tr.find("span")
                    if not label or not name_span:
                        continue
                    label_text = label.get_text(strip=True)
                    name = name_span.get_text(strip=True)
                    if "Grantor" in label_text:
                        grantors.append(name)
                    elif "Grantee" in label_text:
                        grantees.append(name)
            record["Grantors"] = ", ".join(grantors)
            record["Grantees"] = ", ".join(grantees)


        # find the <td> that contains the nested legal description table
        legal_td = cells[5]  # adjust index as needed
        # print(legal_td)
        # collect all text inside child <span> tags
        parts = []
        for span in legal_td.find_all("span"):
            text = span.get_text(strip=True)
            if text:  # skip empty spans
                parts.append(text)

        legal_description = " ".join(parts)
        record["LegalDescription"] = legal_description

        # --- Extract Pages (always 2nd to last cell) ---
        if len(cells) >= 2:
            record["Pages"] = cells[-2].get_text(strip=True)
        
        data.append(record)
        # break

    # Convert to DataFrame
    df = pd.DataFrame(data)

    return df

def get_table(instrument_type, starting_date, ending_date):
    html = get_html_table(instrument_type, starting_date, ending_date)
    df = parse_html_to_excel(html)
    return df